  const [value, setvalue] = useState(0);

  const handleSubmit = (e, value) => {
    e.preventDefault();
    console.log("Submit: " + { value });
  };

  return (
    <>
      <form>
        <h1>Profile</h1>
        <TextInput initText="Type your message" />
        <h1>Password</h1>
        <TextInput initText="Type your password" />
        <FormButton
          onClick={handleSubmit}
          label="Submit"
          style={{ marginTop: "1rem" }}
        />
      </form>
    </>
  );
};

export default Profile;
